VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, ', alcohol). Buprenorphine is less sedating and is preferred if a particular risk of sedation exists. Methadone, and to a lesser extent buprenorphine, can cause QT interval prolongation, increasing the risk of cardiac arrhythmias and sudden death. Therefore, methadone and buprenorphine must be used with caution, and electrocardiogram monitoring and AOD specialist advice sought when used in combination with other medications or substances that also prolongate the QT interval (e.g. alcohol, cocaine, amphetamines). Methadone and buprenorphine are both metabolised by hepatic cytochrome P450 (CYP) enzymes. Medicines that induce or inhibit CYP enzymes (e.g. antiepileptics, steroids, antibiotics, nicotine, omeprazole, cimetidine) can result in under- or overdosing of methadone or buprenorphine. The impact of hepatic metabolism is less marked in buprenorphine and there appear to be fewer clinically relevant drug interactions with buprenorphine compared with methadone.', '{0.11905424296855927,0.23360246419906616,0.021026678383350372,0.05838203430175781,0.0985197126865387,0.04999180883169174,-0.5382497906684875,-0.45120498538017273,0.3576686680316925,-0.8468862175941467,0.4505283236503601,-0.037474535405635834,0.4759472906589508,0.3356039822101593,-0.46646368503570557,0.1472429633140564,-0.562657356262207,0.8828707933425903,0.6615713238716125,-0.009361812844872475,-0.6585550904273987,-0.05700405314564705,-0.3643375039100647,-0.16064463555812836,0.09989477694034576,0.3669811189174652,-0.5907791256904602,-0.0756642296910286,-0.4035070836544037,-0.7002301216125488,-0.34108924865722656,-0.11394748091697693,-0.04452605918049812,0.048432908952236176,0.4450158476829529,-0.25774094462394714,-0.35413241386413574,1.4933761358261108,-0.6368483901023865,-0.4045282304286957,-0.9634124040603638,0.5037491321563721,0.4565003514289856,-0.4672403037548065,-0.7408438920974731,-0.3670998811721802,0.25036346912384033,-0.012651