VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'appear to be fewer clinically relevant drug interactions with buprenorphine compared with methadone. ODT is long term, and for some, it is lifelong. Some people may wish to gradually stop treatment. This is best done when people have stable mental and physical health and are housed with good social connections and purpose. LAIBs may be preferred due to their long duration of action after the last dose which can mitigate the experience of withdrawal. Discharge planning should include advice and education around relapse prevention, overdose risk management, and follow-up as needed. There are ODT programs in every state and territory in Australia. These programs provide controlled supply of ODT under robust legal and regulatory frameworks to facilitate access to treatment and minimise unsanctioned supply and leakage into informal drug markets. The programsâ€™ fundamental approach involves significant supervision of patient progress and medication administration.', '{0.18586114048957825,0.15743348002433777,0.2705133855342865,0.14880211651325226,-0.06340837478637695,-0.21525737643241882,0.22252900898456573,-0.32213738560676575,-0.1649942398071289,-1.0447518825531006,0.19746316969394684,0.2591554820537567,0.07030059397220612,-0.16878361999988556,-0.006241171155124903,-0.3231601119041443,0.29537078738212585,0.5313871502876282,0.15104897320270538,-0.048241421580314636,-0.671034574508667,-0.2587544918060303,-0.333595335483551,-0.5567317008972168,-0.3918127715587616,0.1355544924736023,-0.11952060461044312,-0.5199273228645325,0.4690752923488617,0.09632457792758942,-0.8136346936225891,0.13293640315532684,-0.1357836276292801,0.4386964440345764,-0.03978536278009415,-0.6586660742759705,0.03063235990703106,0.4612899124622345,-0.9370234608650208,0.13425320386886597,-1.224881887435913,1.0777838230133057,-0.4121732711791992,-0.5965884923934937,-0.8143330812454224,-0.7036921977996826,-0.12497438490390778,-0.053927