VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 14, 'methadone are highly effective, evidence-based treatments for people experiencing opioid dependence. Most people can be effectively managed by GPs and NPs working in primary care, while those with more complex needs may benefit from initial AOD specialist care and transfer to primary care once their complexity has settled. It can be highly rewarding work for the health professionals involved. Support and advice through local AOD specialist services and jurisdictional telephone lines are available. Health professionals should refer to jurisdictional regulations and guidelines when providing care. Access to treatment remains limited, and the engagement of GPs, NPs and pharmacists is crucial to ensure all who need it can receive treatment in the setting most suited to their needs. 
 
 * The use of buprenorphine in planned withdrawal in the community setting generally needs to be authorised by the ODT program in each state and territory.', '{0.611802339553833,-0.07271456718444824,0.6124135851860046,-0.15532740950584412,0.2425045669078827,-0.09646956622600555,0.2211645394563675,-0.28955569863319397,-0.7227578163146973,-1.0604852437973022,0.1824038177728653,0.11326800286769867,-0.04419426992535591,-0.2758224606513977,-0.37124529480934143,-0.3029240667819977,-0.2205435186624527,0.9172499775886536,0.06267241388559341,-0.042435482144355774,-0.6103610992431641,0.005745192989706993,-0.33386749029159546,-0.3968700170516968,-0.22639527916908264,-0.12105484306812286,-0.3056572675704956,-0.8220246434211731,0.07877229154109955,0.17835292220115662,-0.7211232781410217,0.1543348729610443,-0.015272621996700764,0.29594850540161133,0.09129692614078522,-0.6848450899124146,0.005401855334639549,0.24470674991607666,-1.492963194847107,0.07004435360431671,-0.7502150535583496,0.990325391292572,-0.5507097244262695,-0.3899385333061218,-0.4856009781360626,-0.7304503917694092,0.0006804817239753902,0.009413332678377628,0.23521706461906433,0.6239899396896362,-0.0008025345159694552,0.10310349613428116,0.06475358456373215,0.8157427906990051,-0.13838456571102142,0.17712277173995972,-0.4298330545425415,0.07145087420940399,0.31441816687583923,0.3132352828979492,0.16333088278770447,-0.10672872513532639,-0.07879702746868134,-0.7828275561332703,-0.8071392774581909,0.8813707828521729,0.045760780572891235,-0.012406980618834496,-0.3967435359954834,-0.4876113533973694,0.2644443213939667,0.2339278608560562,0.18327581882476807,-0.5454083681106567,-0.42557281255722046,0.7209909558296204,0.03360545262694359,0.20127634704113007,0.3670804500579834,0.2911910116672516,0.2048340141773224,-0.6123154759407043,0.13996349275112152,-0.4112226366996765,0.3478192389011383,-0.3204585313796997,0.06149517372250557,0.1326737254858017,0.3416255712509155,0.6508257985115051,0.0029283170588314533,0.1278647482395