VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Chronic kidney disease (CKD) affects 10â€“15% globally and is a marked independent risk factor for cardiovascular disease. Prevalence estimations are essential for public health planning and implementation of CKD treatment strategies. This study aimed to estimate the prevalence and stages of CKD in the population-based Lolland-Falster Health Study, set in a rural provincial area with the lowest socioeconomic status in Denmark. Additionally, the study characterized participants with CKD, evaluated the overall disease recognition, including the awareness of CKD and compared it with other common conditions. Cross-sectional data were obtained from clinical examinations, biochemical analyses, and questionnaires. CKD was defined as albuminuria (urine albuminâ€“creatinine ratio â‰¥30â€‰mg/g), estimated glomerular filtration rate (eGFR) <60â€‰ml/min/1.73 mÂ², or by a diagnosis in the National Patient Register.', '{0.37268614768981934,0.48698821663856506,0.44300737977027893,0.5008320212364197,-0.16430239379405975,-0.4368070662021637,0.720838725566864,-0.35572367906570435,-1.328925371170044,0.013112659566104412,-0.42036324739456177,0.3101958632469177,0.7656318545341492,0.5049549341201782,0.3053705394268036,0.23933036625385284,0.15060921013355255,0.8742982745170593,0.49172738194465637,-0.25257885456085205,-0.8756603598594666,0.19317293167114258,-0.6440403461456299,0.5617868900299072,-0.2090446949005127,0.08772990852594376,0.034501805901527405,-0.022886965423822403,-0.14153431355953217,-0.7431952357292175,0.44093742966651917,-0.7069339752197266,0.7846823930740356,-0.40924298763275146,0.5176035165786743,0.19912610948085785,0.029334181919693947,-0.8632984757423401,-0.8642635941505432,0.937714159488678,-0.2932737469673157,-0.9149684309959412,0.2040403038263321,-1.061305284500122,0.3191451132297516,-0.2920142412185669,-0.4667675197124481,0.6161718964576721,0.3512120544910431,0.4102916717529297,-0.71454823017120