VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, '>80% for diabetes, and the overall CKD recognition (self-reported or registered diagnosis) was 7.1%. Thus, in this population-based study, CKD was highly prevalent but poorly recognized, indicating great potential for preventing CKD progression and related complications. Additional content an author video to accompany this article is available at:  Chronic kidney disease (CKD) affects over 10% of the global adult population, is becoming more prevalent and has emerged as the 11th leading cause of death [ Patients with CKD often have no or very few symptoms, leaving both the patients and clinicians unaware of the condition. This lack of awareness impedes timely intervention to prevent CKD progression and complications, such as cardiovascular disease (CVD) [ In Denmark, stage 3â€“5 CKD prevalence is approximately 5% [ Denmark is a small high-income country with a population of approximately 5.9 million.', '{-0.2502790689468384,0.21888688206672668,0.2715461552143097,0.06336899846792221,0.23148177564144135,0.44598111510276794,0.030835459008812904,0.12094802409410477,-0.6963977813720703,-0.6536633372306824,-0.3100985884666443,1.234083652496338,0.3990239202976227,0.26894381642341614,-0.10799191147089005,0.09712689369916916,-0.505487322807312,0.483771413564682,0.36023786664009094,-0.10562922805547714,-0.9181763529777527,-0.18027585744857788,-0.8463848829269409,0.17722120881080627,-0.10131514817476273,0.06164683401584625,-0.6628637909889221,-0.4532250463962555,0.030076485127210617,-0.43355876207351685,0.18214496970176697,-1.0712882280349731,0.6361438035964966,-0.5978137254714966,-0.18298344314098358,0.12389294058084488,-0.14427688717842102,0.06951361149549484,-0.7201488018035889,0.6613104939460754,-0.1176813393831253,0.022631287574768066,0.14186468720436096,-0.34340938925743103,0.1903083473443985,0.24480019509792328,-0.13067211210727692,0.3633166253566742,0.5081539750099182,-0.16970527172088623,-0.640327