VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'ximately 5% [ Denmark is a small high-income country with a population of approximately 5.9 million. Despite having a tax-funded healthcare system with free hospital access and relative genetic homogeneity within the population, health outcomes in Denmark vary considerably by region [ As part of LOFUS, the present cross-sectional study investigated the epidemiology of CKD. Unlike register-based studies, this study assessed CKD prevalence by systematic examination of albuminuria and decreased estimated GFR (eGFR), covering both early and late stages. Additionally, the study characterized participants with CKD and identified individuals who were unaware of their condition or unrecognized by the healthcare system. We hypothesized that the prevalence of CKD in Lolland-Falster was >10% and that the proportion of unrecognized CKD was >50%, thus representing a substantial public health issue contributing to the health disparities in the area.', '{0.01780606620013714,0.4272027611732483,0.4518683850765228,0.5588258504867554,0.004993992391973734,-0.68887859582901,0.5709361433982849,-0.1697065532207489,-1.5210728645324707,-0.2114398032426834,-0.34058213233947754,0.5234877467155457,0.7421180009841919,0.49830129742622375,-0.04701097682118416,0.020090343430638313,0.4031359851360321,0.8142365217208862,0.27556246519088745,-0.06590541452169418,-0.8441951870918274,0.1461106836795807,-0.5884073376655579,0.3739563822746277,0.20376767218112946,0.21272630989551544,-0.159462571144104,-0.35678088665008545,-0.0922497883439064,-0.5958192348480225,0.42132315039634705,-0.7846264839172363,0.8597372174263,-0.12969578802585602,0.5146124362945557,-0.03842692822217941,-0.32752394676208496,-0.7215322852134705,-1.1330431699752808,0.6712110042572021,-0.05974200740456581,-0.8694974184036255,0.2296319603919983,-1.1478854417800903,-0.12071780860424042,-0.6307685375213623,-0.15897586941719055,0.4465811550617218,0.6678140759468079,0.25