VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'r Scandinavian studies [ In our study, the proportion of individuals with recognized CKD was low (7.1%) but consistent with similar studies [ CKD is a well-established risk factor for cardiovascular complications and mortality, even in its early stages with normal eGFR and low levels of albuminuria [ Consistent with prior research our findings also establish the significant association between CKD and low educational level, especially a lack of postsecondary education [ Our study was subject to certain limitations. First, because this was a cross-sectional study, we lacked repeated measurements of eGFR and UACR over time. Consequently, there was a risk of overestimating CKD prevalence based on transient decreases in eGFR and increases in UACR [ We report the largest and most comprehensive CKD prevalence study to date in Denmark, based not merely on register data but on systematic clinical and paraclinical examination of a randomly selected population.', '{-0.05355561897158623,0.35626593232154846,0.3903265595436096,0.261560320854187,-0.17707975208759308,-0.39771708846092224,0.1511034369468689,-0.3737669885158539,-0.7591756582260132,-0.07586167007684708,-0.5211646556854248,0.7644115686416626,0.4672848582267761,0.26054179668426514,0.10069382190704346,0.23020006716251373,0.1105031669139862,0.45897263288497925,-0.07162098586559296,0.0065581598319113255,-0.6210741996765137,-0.43157100677490234,-0.5310907959938049,0.2848319709300995,0.13992813229560852,0.0981946587562561,-0.0877201184630394,-0.3160638213157654,-0.09583533555269241,-0.825226366519928,0.5672399401664734,-0.8008825778961182,0.7110605835914612,-0.5608606338500977,0.5640379786491394,0.2241460680961609,-0.4972764849662781,-0.21865662932395935,-0.7360776662826538,0.39237281680107117,0.12948545813560486,-0.39840954542160034,0.19392435252666473,-0.9479702115058899,0.05267420783638954,-0.20069001615047455,-0.39568963646888733,0.162225604057312,0