VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Despite advancements in surgical techniques and implant designs, Periprosthetic joint infection (PJI) continues to be one of the commonest and most devastating causes of failure in total joint arthroplasty. PJIs are associated with significant morbidity and mortality, placing a multifactorial burden on patients, caregivers, surgeons, hospitals, health systems, and economies. The incidence of PJI ranges from 0.5% to 2.3% based on current literature. Mortality rates in PJI subsequent to a primary total hip arthroplasty (THA) range from 4% to 8% after one year. The common treatment for PJI is a two-stage revision THA, which itself is associated with significant morbidity and mortality. The economic burden of PJI is substantial, with treatment costs 3 to 5.6 times higher than primary THA. Patients with PJI experience inferior hip function, lower health-related quality of life scores, and higher odds of developing new onset depression.', '{0.7483906149864197,-0.21893836557865143,0.23819182813167572,0.3710678815841675,-0.8591095209121704,0.1947271227836609,-0.3409249186515808,1.4372646808624268,-0.6197115182876587,0.10397405922412872,0.3557506501674652,0.10820925980806351,0.10661446303129196,-0.9582839012145996,0.6715529561042786,0.0353504978120327,0.8817299008369446,-0.09786814451217651,0.8955051898956299,-0.5135757923126221,0.11195564270019531,0.2370738834142685,0.43257325887680054,0.5250359177589417,0.14821824431419373,0.9490684866905212,0.20850157737731934,-0.6086073517799377,0.5701290965080261,0.5575841665267944,-0.4717777967453003,0.9588221311569214,-0.5867687463760376,0.24977131187915802,0.5507503747940063,-0.0362812839448452,0.0765945315361023,1.1066303253173828,-0.03077666647732258,0.05722024664282799,0.30073845386505127,-0.6054860949516296,0.279602974653244,0.4909134805202484,0.9356439113616943,0.16552244126796722,0.3599534332752228,-0.08514714241027832,0.18788130581378937,-0.814778685569763