VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Paraprobiotics are nonvital bacteria that have health benefits. Recently, they have been incorporated into dairy products as supplements to probiotics. The advantages of using paraprobiotics mainly include superior resistance to processing conditions, extended shelf-life, and safer consumption by people with weaker immune systems. In high-protein ice cream, paraprobiotics enhance freezing stability and eliminate the risks of microbial overgrowth and rare adverse effects. They also promote gut health, regulate immune responses, and have anti-inflammatory properties, which are important for children. Moreover, paraprobiotics enhance the functional value of high-protein ice cream by promoting gut health and immune support, making it an ideal functional supplement for athletes and bodybuilders.', '{-0.28341054916381836,-0.052831560373306274,0.0760519877076149,0.2723343074321747,-0.27102065086364746,0.16977477073669434,0.25486207008361816,0.5950304269790649,0.571783185005188,-0.32912078499794006,-0.6268765330314636,-0.1759975403547287,0.4293011426925659,-0.15655644237995148,0.4933225214481354,-0.3225178122520447,-0.017528709024190903,-0.05456538498401642,-0.23540271818637848,-1.2107409238815308,-0.6935335993766785,0.5929948687553406,-0.012034171260893345,-0.6611111164093018,0.06429211050271988,0.3325294852256775,-0.42188751697540283,-0.2370063215494156,0.22812721133232117,0.21855050325393677,0.05416528880596161,-0.24631863832473755,0.27125295996665955,-0.02036317251622677,0.686202347278595,-0.48396915197372437,0.15698674321174622,0.07163926959037781,0.3353741765022278,-0.031103547662496567,0.5287792682647705,0.14105074107646942,-0.265403151512146,0.4006388187408447,-0.002861388958990574,0.17669031023979187,-0.08120806515216827,-0.28069865703582764,0.4553892910480499,-0.675624430179596,-0.6593421101570129,-0.12039221823215485,-0.12854593992233276,-0.7831694483757019,0.4095161259174347,0.46126207709312