VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'an innovative functional food promoting satiety, supporting muscle growth, and improving metabolism. However, the lactose, fat, and protein contents of traditional ice creams can pose challenges to individuals with lactose intolerance, milk protein allergies, or dietary restrictions [ Many dairy products, commonly used as carriers of probiotics, have unfavorable conditions for the survival of paraprobiotics. For instance, the high acidity of yogurt or thermal processes such as pasteurization and sterilization often result in a reduction or complete loss of viable probiotic cells [ Numerous clinical studies have been conducted on the use of paraprobiotics in dairy products, which can inform their application in high-protein ice cream.', '{-0.1264292150735855,-0.3127239942550659,0.22460226714611053,0.6759973168373108,-0.08995626866817474,0.07443754374980927,0.2143731415271759,0.44704902172088623,0.5017568469047546,-0.2937701940536499,-0.7567611336708069,-0.11333023011684418,0.04139823466539383,-0.032562755048274994,0.6777722239494324,-0.5960147976875305,0.14028719067573547,0.2855440676212311,-0.6520794630050659,-1.391085147857666,-0.5694217681884766,0.8794611096382141,-0.09863926470279694,-0.6305897831916809,0.17779000103473663,0.5468866229057312,-0.5805948972702026,-0.4031149446964264,-0.32935500144958496,0.22234471142292023,0.1634960025548935,-0.4128302037715912,0.37381798028945923,-0.40030258893966675,0.24764904379844666,-0.21899756789207458,-0.21677051484584808,0.08969506621360779,0.45107272267341614,-0.038977619260549545,0.22160248458385468,0.4621802568435669,-0.29830336570739746,0.17915600538253784,0.27778899669647217,0.05400766059756279,0.4774916470050812,-0.0877397283911705,0.47213414311408997,-0.6239978671073914,-0.616293728351593,-0.01770424284040928,0.07188762724399567,-0.4329058825969696,0.8521989583969116,0.4887291193008423,-0.19232293963432312,0.6011041402816772,0.07137477397918701,-