VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'araprobiotics in converting a conventional convenience food into a health-promoting functional food. Until now, no application of paraprobiotics has been reported in ice cream formulation. This review is aimed at discussing the technologies related to paraprobiotic production, the formulation of high-protein ice cream, and the benefits of incorporating paraprobiotics into such ice cream. It also investigates the impacts of paraprobiotics on gut function and the immune system, ultimately positioning high-protein ice cream as a healthy functional food dessert for athletes. Paraprobiotics exhibit biological functions similar to live probiotics; nevertheless, since they are inactivated, they do not pose risks such as antibiotic resistance gene transfer and systemic infections.', '{-0.23822978138923645,-0.42346692085266113,-0.14948225021362305,0.5316726565361023,-0.09955299645662308,0.1631380319595337,0.04773344844579697,0.6272193789482117,0.6874911785125732,-0.16579654812812805,-0.5170466303825378,-0.017655031755566597,0.39177510142326355,0.10010391473770142,1.0193030834197998,-0.1565106362104416,-0.3067905604839325,0.17218828201293945,-0.9158113598823547,-0.8773193955421448,-0.47502243518829346,0.6202755570411682,-0.07054822891950607,-0.7890845537185669,0.43465113639831543,0.7277088165283203,-0.20074833929538727,-0.35325849056243896,-0.21070218086242676,0.03373387083411217,0.1021401658654213,-0.21367843449115753,0.24507829546928406,0.23338425159454346,0.4185656011104584,-0.42730438709259033,0.12371991574764252,0.26965266466140747,0.11103535443544388,0.04461263492703438,0.377555251121521,0.26982825994491577,0.08516369014978409,0.7233034372329712,0.3349902331829071,-0.013773963786661625,0.15362687408924103,0.29756391048431396,0.24902145564556122,-0.6788437962532043,-0.5659822225570679,-0.04908335581421852,-0.07987776398658752,-0.8850329518318176,0.794658899307251,0.8996180891990662,-0.068261384963989