VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 16, 'eir PGN components, has revealed significant benefits for intestinal function and disease treatment. PGN, which is a moiety of the bacterial cell wall, has a substantial effect on immune system stimulation even if the cell is nonviable. In the gut, they help modulate the immune response by PRRs, including TLRs, on the intestinal epithelium. This interaction enhances the generation of anti-inflammatory cytokines, which help maintain gut homeostasis and protect against inflammatory diseases such as inflammatory bowel disease (IBD) and irritable bowel syndrome (IBS) [ TAs account for as much as 50% of the dry weight of lactobacilli cell walls [ 
