VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 17, 'ponents like polysaccharides also have a considerable effect on the functionality of paraprobiotics. Polysaccharides are commonly found on the surface of Gram-positive bacteria such as  Paraprobiotics have several key technological advantages over live probiotics, particularly in the formulation of high-protein ice cream, as they can be added to the ice cream without concerns for survival during processing, storage, and distribution. While live probiotics are susceptible to heat, high pressure, and acidic conditions, paraprobiotics remain stable and retain their functional properties under adverse conditions including high temperatures, HPP, low pH, and long storage times [ Furthermore, paraprobiotics enhance the functional value of food products by providing health benefits such as immune system modulation and gut health improvement, similar to live probiotics, but with greater stability.', '{0.25659453868865967,-0.2833557426929474,0.12251851707696915,0.3119623363018036,-0.3132399618625641,-0.018643008545041084,0.24569562077522278,0.40547385811805725,0.5204434394836426,-0.20359760522842407,-0.4448711574077606,-0.13487419486045837,0.07297269999980927,-0.32018157839775085,0.1187305599451065,-0.35395577549934387,0.07955645024776459,-0.1464347541332245,-0.03267195075750351,-1.494889259338379,-0.6901167631149292,0.604214608669281,-0.14012590050697327,-0.8597201108932495,0.011901834048330784,0.6121247410774231,-0.5688124299049377,-0.31872400641441345,0.2305157482624054,0.4464877247810364,0.1759072095155716,-0.055031776428222656,0.12397044897079468,-0.0234611164778471,0.5659493803977966,-0.5294902324676514,-0.1360345035791397,0.3125224709510803,0.5752537250518799,0.20716574788093567,0.3665022850036621,0.40820443630218506,-0.01201787032186985,0.5327840447425842,0.0075638750568032265,0.33496522903442383,-0.028241747990250587,-0.1582217812538147,0.3365948498249054,-0.7999415397644043,-0.5941166281700134